import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { RouterModule } from '@angular/router';
import { AppRotas } from './app-routing.module';
import { HttpClientModule } from '@angular/common/http';
import { FormsModule, ReactiveFormsModule } from '@angular/forms';
import { CadastroAdminComponent } from './pages/CPD/cadastro-admin/cadastro-admin.component';


@NgModule({
  declarations: [
    AppComponent,
    CadastroAdminComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    RouterModule.forRoot(AppRotas),
    HttpClientModule,
    FormsModule, // Se estiver usando template-driven forms
    ReactiveFormsModule // Se estiver usando reactive forms
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
